import React from 'react'
import IMG from '../media/heme.jpg'
const Item = (props) => {
  const imgURL = require(`../media/${props}`)
  return (
    <div>
      <span>{props.title}</span>
      <span>{props.description}</span>
      <span>{props.price}</span>
      <img src={require(`../media/${props.image}`)} alt="IMAGE"/>
      <img src={require("../media/heme.jpg")} alt="IMAGE"/>
    </div>
  )
}

export default Item
